import React from 'react'
import "./Navbar.css"
import BugImg from "../images/bug.svg"

const Navbar = () => {
  return (
    <div className='top-wrapper'>
        <img src={BugImg} className='Bug-image' alt='Bug' /> <h1>Bug Tracker</h1>
    </div>
  )
}

export default Navbar
